//home page

import React from 'react'
import HeroSection from '../components/HeroSelection'
import InfoSection from '../components/InfoSection'
import { homeObjOne, homeObjTwo } from '../components/InfoSection/Data'
import Benefits from '../components/Benefits'
import Navbar from '../components/Navbar'
import Footer from '../components/Footer'
import { GlobalProvider } from './context/GlobalState';
import { Header } from './components/Tracker/Header';
import { Balance } from './components/Tracker/Balance';
import { IncomeExpenses } from './components/Tracker/TransactionList';
import { AddTransaction } from './components/Tracker/AddTransaction';
import { TransactionList } from './components/Tracker/TransactionList';

// files from backend 

//import { GlobalProvider } from '../context/GlobalState'



const Home = () => {

    return (
        <>
        <Navbar />
        <HeroSection />
        <InfoSection {...homeObjOne}/> 
        <InfoSection {...homeObjTwo}/> 
        <Benefits />
        <GlobalProvider>
        <Header />
        <Balance></Balance>
        <IncomeExpenses></IncomeExpenses>
        <TransactionList></TransactionList>
        <AddTransaction></AddTransaction>
        </GlobalProvider>   
        <Footer/>
        </>
    )
}

export default Home
